// src/pages/Tutor/TutorHome.jsx
import React, { useState, useEffect } from 'react'
import { useNavigate } from 'react-router-dom'
import { Row, Col, Card, ListGroup, Button, Container } from 'react-bootstrap'
import api from '../../services/api'
import { format } from 'date-fns'
import ptBR from 'date-fns/locale/pt-BR'

export default function TutorHome() {
  const [pets, setPets] = useState([])
  const [selectedPet, setSelectedPet] = useState(null)
  const [eventos, setEventos] = useState([])
  const navigate = useNavigate()

  // formata ISO para "dd/MM/yyyy, HH:mm:ss"
  const formatDateTime = iso =>
    format(new Date(iso), "dd/MM/yyyy, HH:mm:ss", { locale: ptBR })

  useEffect(() => {
    // carrega só os pets atribuídos a este tutor (supomos que o token já traz o ID)
    api.get('/tutores/meu-pet') // endpoint hipotético que retorna só os pets deste tutor
      .then(({ data }) => {
        setPets(data)
        if (data.length) setSelectedPet(data[0]._id)
      })
      .catch(console.error)
  }, [])

  useEffect(() => {
    if (!selectedPet) return
    // busca só os eventos para este tutor *e* este pet
    api.get(`/eventos/tutor/${selectedPet}`)
      .then(({ data }) => {
        setEventos(data)
      })
      .catch(console.error)
  }, [selectedPet])

  const handleCheckin = () => {
    navigate(`/tutor/checkin/${selectedPet}`)
  }

  const handleCheckout = eventoId => {
    navigate(`/tutor/checkout/${eventoId}`)
  }

  return (
    <Container className="mt-4">
      <div className="d-flex justify-content-between mb-3">
        <h2>Painel do Tutor</h2>
        <Button variant="secondary" onClick={() => navigate('/logout')}>
          Sair
        </Button>
      </div>

      <Row>
        <Col md={4}>
          <Card>
            <Card.Header>Meus Pets</Card.Header>
            <ListGroup variant="flush">
              <ListGroup.Item
                action
                active={selectedPet === null}
                onClick={() => setSelectedPet(null)}
              >
                Todos Pets
              </ListGroup.Item>
              {pets.map(p => (
                <ListGroup.Item
                  key={p._id}
                  action
                  active={selectedPet === p._id}
                  onClick={() => setSelectedPet(p._id)}
                >
                  {p.nome}
                </ListGroup.Item>
              ))}
            </ListGroup>
          </Card>
        </Col>

        <Col md={8}>
          <Card>
            <Card.Header className="d-flex justify-content-between align-items-center">
              Meus Eventos
              <Button variant="success" size="sm" onClick={handleCheckin}>
                Check-in
              </Button>
            </Card.Header>

            <ListGroup variant="flush">
              {eventos.length === 0 && (
                <ListGroup.Item>Nenhum evento registrado.</ListGroup.Item>
              )}
              {eventos.map(evt => (
                <ListGroup.Item key={evt._id}>
                  <div className="d-flex justify-content-between align-items-start">
                    <div>
                      <strong>{evt.tipo}</strong> — {evt.pet.nome}
                      <br />
                      Entrada: {formatDateTime(evt.dataEntrada)}<br />
                      Saída: {evt.dataSaida ? formatDateTime(evt.dataSaida) : 'Em andamento'}
                      <br />
                      Status: {evt.status}
                    </div>
                    {evt.status === 'Ativo' && (
                      <Button
                        variant="warning"
                        size="sm"
                        onClick={() => handleCheckout(evt._id)}
                      >
                        Check-out
                      </Button>
                    )}
                  </div>
                </ListGroup.Item>
              ))}
            </ListGroup>
          </Card>
        </Col>
      </Row>
    </Container>
  )
}
